DROP TABLE IF EXISTS admin_log;

CREATE TABLE `admin_log` (
  `logid` int(8) NOT NULL AUTO_INCREMENT,
  `logdatetime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `lognotes` varchar(255) NOT NULL,
  `logstatus` int(1) NOT NULL,
  `logip` varchar(30) NOT NULL,
  `logref` varchar(30) DEFAULT 'admin',
  `logrefid` int(11) DEFAULT '0',
  PRIMARY KEY (`logid`)
) ENGINE=InnoDB AUTO_INCREMENT=1735 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS admin_setting;

CREATE TABLE `admin_setting` (
  `option_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `option_name` varchar(64) NOT NULL DEFAULT '',
  `option_value` longtext NOT NULL,
  `options_title` varchar(100) NOT NULL,
  `autoload` varchar(20) NOT NULL DEFAULT 'yes',
  PRIMARY KEY (`option_id`),
  UNIQUE KEY `option_name` (`option_name`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS bad_keywords;

CREATE TABLE `bad_keywords` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `type` enum('Regular Expression','Keyword') DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS banners;

CREATE TABLE `banners` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `BannerHeading` varchar(255) NOT NULL,
  `BannerDesc` text NOT NULL,
  `BannerImage` varchar(255) NOT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS careers;

CREATE TABLE `careers` (
  `UID` int(8) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `Name` varchar(150) NOT NULL,
  `Email` varchar(150) NOT NULL,
  `ContactNo` varchar(20) NOT NULL,
  `IntrestedArea` varchar(255) NOT NULL,
  `IntrestedDesignation` varchar(255) NOT NULL,
  `IntrestedCompany` varchar(255) DEFAULT NULL,
  `TopSoftSkills` text,
  `TopTechnicalSkills` text,
  `CurrentStatus` varchar(255) DEFAULT NULL,
  `UploadCV` varchar(255) DEFAULT NULL,
  `SpecialtyExperience` text,
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=174 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS category;

CREATE TABLE `category` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL,
  `orderid` int(11) NOT NULL DEFAULT '0',
  `description` text,
  `catid` int(11) DEFAULT NULL,
  `status` int(11) DEFAULT '1',
  `image` varchar(255) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  `ordermap` varchar(255) DEFAULT NULL,
  `level` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;




DROP TABLE IF EXISTS contents;

CREATE TABLE `contents` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `content_title` varchar(255) DEFAULT NULL,
  `page_title` varchar(255) NOT NULL,
  `content_desc` longtext,
  `description` varchar(255) DEFAULT NULL,
  `keywords` varchar(255) DEFAULT NULL,
  `author` varchar(255) DEFAULT NULL,
  `robots` varchar(255) NOT NULL DEFAULT 'index,follow',
  `orderid` int(11) NOT NULL DEFAULT '0',
  `page_physical_name` varchar(255) DEFAULT NULL,
  `status` enum('active','block') NOT NULL,
  `page_modify_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `page_create_date` datetime NOT NULL,
  `header_image_default` int(11) NOT NULL DEFAULT '0',
  `header_image_text` varchar(255) NOT NULL,
  `promotional_page` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=54 DEFAULT CHARSET=latin1;

