  `EmployeeState` bigint(20) NOT NULL COMMENT 'State Or Province',
  `EmployeeCity` bigint(20) NOT NULL COMMENT 'City Of Employee',
  `EmployeeQualification` bigint(20) NOT NULL COMMENT 'Highest Qualification Of Employee',
  `EmployeeQualificationInst` varchar(225) NOT NULL COMMENT 'College Or University',
  `EmployeeWeb` varchar(255) NOT NULL COMMENT 'Website',
  `EmployeeEmail` varchar(255) NOT NULL COMMENT 'E-Mail Address',
  `EmployeePassword` text NOT NULL COMMENT 'Account Password',
  `EmployeeCompany` varchar(30) NOT NULL COMMENT 'Current Company',
  `EmployeeDesignation` bigint(20) NOT NULL COMMENT 'Current Designation',
