  `EmployeeLogo` varchar(50) NOT NULL DEFAULT 'no-image.png',
  `EmployeeAbout` text NOT NULL,
  `EmployeeVerify` int(1) NOT NULL,
  `EmployeeVerifyCode` varchar(255) NOT NULL,
  `EmployeeSubscription` int(11) NOT NULL,
  `EmployeeSubscriptionExpire` date NOT NULL,
  `AdditionalInformation` text,
  `LastLoginDateTime` datetime DEFAULT NULL COMMENT 'Last Login Date & Time',
  `WelcomeEmail` int(1) DEFAULT '0',
  `TestPhaseEmail` int(1) DEFAULT '0',
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=1445 DEFAULT CHARSET=latin1;

