DROP TABLE IF EXISTS jobs_alerts;

CREATE TABLE `jobs_alerts` (
  `UID` int(11) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `AlertEmployeeUID` int(11) NOT NULL,
  `AlertTitle` text NOT NULL,
  `AlertCompany` int(11) NOT NULL,
  `AlertArea` int(11) NOT NULL,
  `AlertDesignation` int(11) NOT NULL,
  `AlertStatus` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=143 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS jobs_alerts_log;

CREATE TABLE `jobs_alerts_log` (
  `UID` int(11) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `LogEmployeeID` int(11) NOT NULL,
  `LogJobID` int(11) NOT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS jobs_apply;

CREATE TABLE `jobs_apply` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `EmployeeID` bigint(20) DEFAULT NULL,
  `JobID` bigint(20) DEFAULT NULL,
  `UploadedCV` varchar(255) DEFAULT NULL,
  `CoverLetter` text,
  `City` varchar(50) NOT NULL,
  `ApplicationStatus` varchar(50) NOT NULL,
  `InterviewApproval` int(1) DEFAULT '0',
  `InterviewDate` date NOT NULL,
  `InterviewVenue` text NOT NULL,
  `InterviewCity` int(11) DEFAULT NULL,
  `ExpectedSallery` int(11) DEFAULT '0',
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=1575 DEFAULT CHARSET=latin1;

