DROP TABLE IF EXISTS jobs_extra;

CREATE TABLE `jobs_extra` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `JobID` bigint(20) NOT NULL,
  `InfoType` varchar(50) NOT NULL,
  `InfoTypeValue` varchar(255) NOT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=3884 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS jobs_invitations;

CREATE TABLE `jobs_invitations` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `EmployerUID` bigint(20) DEFAULT NULL,
  `EmployeeUID` bigint(20) DEFAULT NULL,
  `JobUID` bigint(20) DEFAULT NULL,
  `Designation` bigint(20) DEFAULT NULL,
  `City` bigint(20) DEFAULT NULL,
  `InvitationStatus` varchar(150) DEFAULT 'Approval Awaited',
  `InvitationApproval` int(1) DEFAULT '0',
  `InterviewApproval` int(1) DEFAULT '0',
  `InterviewDate` date DEFAULT NULL,
  `InterviewVenue` varchar(255) DEFAULT '',
  `InterviewCity` varbinary(11) DEFAULT '',
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS jobs_reminders;

CREATE TABLE `jobs_reminders` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ReminderAppID` bigint(20) DEFAULT NULL,
  `ReminderModule` varchar(30) DEFAULT NULL,
  `ReminderDate` date DEFAULT NULL,
  `ReminderSubject` varchar(255) DEFAULT NULL,
  `ReminderEmail` text,
  `ReminderStatus` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;

