DROP TABLE IF EXISTS newsletters_queue;

CREATE TABLE `newsletters_queue` (
  `nlq_uid` bigint(20) NOT NULL AUTO_INCREMENT,
  `nlq_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `nlg_userid` bigint(20) NOT NULL,
  `nlg_name` varchar(150) NOT NULL,
  `nlg_email` varchar(255) NOT NULL,
  `nlg_status` int(1) NOT NULL,
  PRIMARY KEY (`nlq_uid`)
) ENGINE=InnoDB AUTO_INCREMENT=3666 DEFAULT CHARSET=latin1;

