DROP TABLE IF EXISTS optiondata;

CREATE TABLE `optiondata` (
  `OptionId` int(8) NOT NULL AUTO_INCREMENT,
  `OptionType` int(4) NOT NULL,
  `OptionName` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `OptionDesc` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `Status` int(1) DEFAULT '1',
  PRIMARY KEY (`OptionId`)
) ENGINE=MyISAM AUTO_INCREMENT=1079 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS payments;

CREATE TABLE `payments` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `PaymentDate` date NOT NULL,
  `PaymentUserType` varchar(15) NOT NULL,
  `PaymentUserID` bigint(20) NOT NULL,
  `PaymentInvoiceID` bigint(20) NOT NULL,
  `PaymentStatus` varchar(50) NOT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS site_ads;

CREATE TABLE `site_ads` (
  `ads_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `ads_type` varchar(50) NOT NULL,
  `ads_title` varchar(150) NOT NULL,
  `ads_embed_code` text NOT NULL,
  PRIMARY KEY (`ads_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS subscription_access;

CREATE TABLE `subscription_access` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `AccessSubID` bigint(20) NOT NULL,
  `AccessTypeKey` varchar(50) NOT NULL,
  `AccessAllowed` int(1) NOT NULL,
  `AccessDays` int(3) NOT NULL,
  `AccessModule` text NOT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=InnoDB AUTO_INCREMENT=275 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS subscription_accesstype;

CREATE TABLE `subscription_accesstype` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `AccessTypeKey` varchar(50) NOT NULL,
  `AccessTypeTitle` varchar(255) NOT NULL,
  `AccessTypeDesc` text NOT NULL,
  `AccessTypeModule` varchar(15) NOT NULL,
  PRIMARY KEY (`UID`),
  UNIQUE KEY `AccessTypeKey` (`AccessTypeKey`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS subscription_discount;

CREATE TABLE `subscription_discount` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `DiscountSubID` bigint(20) NOT NULL,
  `DiscountDuration` int(11) NOT NULL COMMENT 'must be in days',
  `DiscountPercent` int(3) NOT NULL,
  PRIMARY KEY (`UID`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS subscriptions;

CREATE TABLE `subscriptions` (
  `UID` bigint(20) NOT NULL AUTO_INCREMENT,
  `SystemDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `PlanTitle` varchar(255) NOT NULL,
  `PlanDesc` text NOT NULL,
  `PlanDays` int(11) NOT NULL,
  `PlanFee` int(11) NOT NULL,
  `PlanStatus` varchar(10) NOT NULL,
  `PlanModule` varchar(20) NOT NULL DEFAULT 'Employer',
  PRIMARY KEY (`UID`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;

