INSERT INTO employer VALUES("14","2016-01-28 02:12:59","Bio-Labs (Pvt) Ltd","Plot# 145, Industrial triangle, Kahuta Road, Islamabad.","03335087873","","81","38","","http://www.bio-labs.net","employer_39458.jpg","","<table><tbody><tr><td style=\"text-align: justify;\">Bio-Labs, an innovative healthcare company combining state of the art equipment together with manufacturing & quality control expertise to provide high-end <br>pharmaceutical products. Our mission is to be a company of high quality standards, committed to medical ethics and consumer satisfaction with environmental and social consciousness while embracing innovation, change and development.<p style=\"text-align: justify;\">Our aim is to create a major role for the company with regards to the development and sales of pharmaceuticals not only in Pakistan but on the international markets as well. Our export presence in Africa, Middle East, Far-East, and other Asian countries is the beginning of this aim. Today Bio-Labs is manufacturing pharmaceutical products including pharma, veterinary & biological products and is living up to the vision of <em><strong>A Comprehensive Health Care Company.</strong></em></p></td></tr></tbody></table>","","33","Muhammad Safdar","03468635321","","35","careers@bio-labs.net","ZEMEEkl7AvK3oRm5bPHfCzrut19K5FSvU/IGtR7XpiE=","careers@bio-labs.net","Active","1","2017-02-02","0","");
