INSERT INTO employer VALUES("22","2016-01-28 02:12:30","Unimark Pharmaceuticals","Plot # 7-A, Street # S-7 National Industrial Zone, Rawat Islamabad","0514499053","","81","38","","http://www.unimarkpharma.com/","employer_22625.png","","<p>UniMark Pharmaceuticals shall provide total customer satisfaction and attain leadership in chosen markets, products and services across the Pakistan, through constructive and exemplary dynamic professional’s and excellence in technology, based on world-class research and development team.</p><p>UniMark Pharmaceuticals seeks to prepare individuals for constructive and exemplary leadership roles, and shaping medical remedies and marketing, through strength in research and development in pharmaceuticals, all dedicated to providing meaningful contributions to society.</p><p>UniMark Pharmaceuticals will serve its employees by establishing and maintaining an environment that promote professional growth, a supportive spirit at all levels, respect for the individual and his/her uniqueness in all aspects of humanness and strengthen organization through human resource welfare. We want to add value by promoting partnership and networking with other national and international institutions.</p>","","33","Tariq Khan","03345784444","","98","mcunimark@gmail.com","aO9D9iLJWkvPbXMjopfK6fnANDlRG9ksRY/plhYLtS8=","tariqniazi.zee@gmail.com","Active","1","2017-01-03","0","");
INSERT INTO employer VALUES("23","2016-05-17 03:37:22","Goldsheff Int’l","282-H-1 Johar Town Lahore","042-35314557","","41","40","","www.goldsheff.com","employer_5542.jpg","","<p style=\"text-align: justify;\">Goldsheff was established on August 14, 2002 as global concern with the initiative of providing par excellence service to humanity in health sector.&nbsp;</p><p style=\"text-align: justify;\"><br>Goldsheff is a blend of the best value entrepreneurship, strong work ethics, and strict compliance to current Good Manufacturing Practices (cGMP), Good Laboratories Practices (GLP) within variety of products/ segments. <br><br>Goldsheff has attained this prestigious position through continuous focus on team work, innovative marketing skills and modern production facilities. With excellence product range, professional attitude and focus on marketing novel, the company has emerged as a fast growing enterprise ensuring global future prospectus.&nbsp;</p>","","33","Asif Raza","03364062222","","35","info@goldsheff.com","AZzHYf+8W5iS3EE6fyFlaLY0SNWyMR7aiw+DubLGkwU=","tm@goldsheff.com","Active","1","2017-02-02","0","");
