INSERT INTO employer VALUES("25","2016-01-28 02:11:07","Akhai Pharma","Akhai Arcade , 103-K ,Block -2 , PECHS Shahra e Qauideen, Karachi."," 03351255662","","42","72","","www.akhai.com ","employer_18309.JPG","","<p style=\"text-align: justify;\"><strong style=\"background-color: initial;\">Akhai</strong> Group of companies providing affordable medicines to promote health since 1958.</p><p style=\"text-align: justify;\">The core specialty of Akhai group is pharmaceuticals manufacturing, import, marketing and distribution. The Akhai group is operating through its own network with highly skilled and trained team members. The group has a leading portfolio of products and medicine that support wellness as well as treatment and cures for diseases across a broad range of therapeutic areas. Akhai has a pipeline of promising new products that have the potential to challenge most of the diseases of current times.</p>","","33","Faisal Shafi","03352441144","","270","navaid.anwar@yahoo.com","B6T2cNPXSPDQGpi67nuqvctVClpCJMN+RtcVP0xp32k=","faisalshafi@akhai.com","Active","1","2017-02-02","0","");
INSERT INTO employer VALUES("26","2016-04-11 22:39:15","ATCO LABORATORIES LTD","B-18, SITE AREA, KARACHI","111-111-645","","42","72","","atcolab.com","employer_93571.png","","<p style=\"text-align: justify;\">ATCO Laboratories Limited is one of the pioneers in Pakistan’s pharmaceutical industry sector, and has been serving the country’s healthcare system over the last four decades.</p><p style=\"text-align: justify;\"><br>ATCO develops, formulates and markets high quality generics at its state-of-the-art cGMP compliant manufacturing facility based in Karachi, which is the industrial hub of Pakistan.<br><br>ATCO is WHO-GMP certified from Pakistan’s Ministry of Health and holds other accreditations from various health authorities of the world.</p>","","33","Jawad Hussain Khan","03456264667","","271","personnel@atcolab.com","DXnYqJthA6aQGny1BfCleatN7JMGKVGIpGVyCFtyNCQ=","personnel@atcolab.com","Active","1","2017-01-04","0","");
INSERT INTO employer VALUES("27","2016-03-15 22:51:50","Biolex Pharma"," Westridge  Rawalpindi Cantt","0514940611","","41","39","","","employer_3887.png","","<p>Biolex Pharma operates as a marketing company in Pakistan. Biolex Pharma was founded in 2011. The company is based in Islamabad the capital of Pakistan,on 16th june 2011. Biolex\'s commitment to innovative solutions in disease prevention, treatment and care for the health and well being of people worldwide is embodied in our human health care (hhc) mission. hhc means we regard patients and their families as the most important participants in the healthcare process.</p><p>The hhc mission governs the way we do business - the research we do, the products we develop, the way we train our employees and the allocation of our financial resources.</p><p>Our goal is clear: We look for and produce innovative solutions - specialty products - that can help satisfy unmet medical needs and contribute to the health and well being of people worldwide. We can achieve this goal independently or in collaboration with other companies.</p><p>The hhc symbol derives from the signature of Florence Nightingale, the famed healthcare pioneer who devoted her life to caring for others and never lost sight of the importance of listening to her patients. Her example inspires us to understand and help meet the needs of patients and their families - to enhance their quality of life.</p><p>Understanding and internalizing these patient-focused concepts has grown with time, and our employees will attest to the fact that our commitment to our mission, vision and values is a point of true differentiation for Biolex.</p>","","33","Saeed Akbar","03337101276","","227","info@biolexpharma.com","tDBdNNr2Ca5i/MhGZSBxhL1zLrnsp7pEhcDidGfyfdM=","info@biolexpharma.com","Active","1","2017-03-15","0","");
