INSERT INTO employer VALUES("32","2016-01-14 03:46:29","Brookes Pharma (Private) Limited","Plot No. 58, Sector No. 15, Korangi Industrial Area","021-35066280-2","","42","72","","http://www.brookespharma.com/","employer_80973.JPG","employer-cover_83899.JPG","<p style=\"text-align: justify;\">Brookes Pharma (Private) Limited one of the leading and fastest growing pharmaceutical firms of Pakistan. Operating since 1986 as a manufacturer of premium quality medicines, Brookes is now a sophisticated and advanced production facility, dedicated to making a broad array of highly specialized, ethical medicines in a vast range of dosage forms from tablets, capsules, pellets and gels to injectibles, granules, suspensions and syrups. The product portfolio of Brookes includes medicines under product lines of gastro-enterology, anesthesia, dermatology, cardiology, NSAID and ant-septic drugs.</p><p style=\"text-align: justify;\">Situated in Korangi, Karachi over a covered area of 60,000 square feet, Brookes operates under licenses and technical collaboration of large-scale pharmaceutical organizations including Merz Pharma Germany and Edmond Pharma Italy. Being a company that believes in a collective endeavor and cooperation, Brookes remains in pursuit of establishing and maintaining business relationships.</p>","","33","Raheel Mahmood","03433065689","","35","raheel.mahmood@brookespharma.com","6xhkjSRGphedsBxxOkMnJyyPiJb1rZhpep1+cuEVEiU=","raheel.mahmodd@brookespharma.com","Active","1","2017-01-01","0","");
INSERT INTO employer VALUES("35","2016-01-28 02:05:55","The Searle Company","First Floor NIC LBuilding Abbassi Shaheed Road","35674321","","42","72","75330","http://searlecompany.com/about.html","employer_63847.jpg","","<p>Searle Pakistan Limited (SPL) was incorporated in Pakistan as a Private Limited Company on October 5, 1965 as a subsidiary of G.D. Searle & Co., U.S.A. In 1966, Searle Pakistan (Private) Limited acquired a small manufacturing facility in S.I.T.E. and production of Aldactone, Lomotil, Diodoquin, Ovulen, Neomycin Sulphate, Probanthine and Hydryllin, etc. started there. Over the years the operation expanded and during 1984 construction of a new factory started. During mid 1986 manufacturing operations of high quality pharmaceutical products commenced at this newly built factory at Plot # F-319, S.I.T.E. Area, Karachi, measuring 5.24 acres. </p><p>Searle\'s was renamed as The Searle Company Ltd. (TSCL) and its manufacturing facility conforms to the strictest requirements of GMP and employs systems and procedures of the highest standards to provide manufacturing, quality control, warehousing and physical distribution services to the company, medical profession and ultimate users. The plant is being significantly expanded in all areas to cater for its ever expending manufacturing operations in futur</p>","","33","Shahzad Shafiq Khan","03343939198","","234","mpa.hrm@gmail.com","5mRemTh5SUZXVhZ+9q49tyaq6gZRM34HuiCwQLcI87E=","pharmajobs@searlecompany.com","Active","1","2017-02-01","0","");
INSERT INTO employer VALUES("36","2016-01-25 03:41:32","Norvins Enterprises Pakistan","Dhedhi Business Avenue SITE karachi","02132588866","","42","72","75300","","employer_32926.jpg","","<p>Norvins enterprises Pakistan is not just another pharmaceutical company. It is a team of highly motivated & committed professionals focused on Ethical working. Our vision is to become the leading pharmaceutical company in Pakistan and around the world by providing the very best quality medicines to the Patients and Healthcare professionals. We strive to achieve highest accreditations and certifications to prove and affirm the very best quality of our products.</p>","","33","Kamran Shahid","03218970567","","67","kamran.norvinspk@gmail.com","ce8EByRY1czpKfDmuaS+pqn/5n9WtYPQB93m1TbN2b0=","Kamran.norvinspk@gmail.com","Active","1","2017-02-01","0","");
