INSERT INTO employer VALUES("39","2016-02-15 22:55:00","Ethical Laboratories Pvt. Ltd. ","14-km Multan Road Thokar Niaz Beg Lahore","042-35299416-8","","41","40","","http://www.ethical.com.pk","employer_29559.png","","<table><tbody><tr><td>Established in 1962 as a sister concern of M/S Haji S. Ameerdin & Sons, who are one of the oldest opticians in South Asia, since 1864, having branches in all major cities of Pakistan. They also deal in contact lens and ophthalmic electromedical equipment and devices. Their other subsidiary is M/S E. Plomer & Co. one of the oldest pharmacists since the time of East India Company.<p style=\"text-align: justify;\">Ethical Labs. was established in collaboration and technical direction of M/S Smith Miller & Patch of USA. The production started in 1965, and operations continued till 1972. Ethical continued making their products under generic mainly OTCs, Vitamins, Cough Syrups, Liver Products, Anti-malarials etc.</p><p style=\"text-align: justify;\">In 1983 Ethical Labs. entered into a collaboration with M/S Coopervision of California, USA (formerly SMP) to produce their ophthalmic pharmaceuticals. Coopervision was one of the top three ophthalmic companies of USA.</p><p style=\"text-align: justify;\">The whole sterile production area and equipment were upgraded and added on the direction of Coopervision to conform to their standards and specifications and those of International cGMP.</p><p style=\"text-align: justify;\">Ethical is now established in Pakistan as one of the leading ophthalmic pharmaceutical manufacturers, catering for almost all the requirements needed in ophthalmic practice, covering diagnostics, local anaesthetics, NSAIDS, Anti-inflammatories, Anti-infectives, Anti-allergics, Dry Eye Treatment, Beta Blockers, Anti glaucoma, Vitamins/ Anti-oxidants for Cataract, Viscoelastics etc.</p><p style=\"text-align: justify;\">We have state of the art manufacturing and quality control equipment, meeting the rigid standards of cGMP and WHO.</p></td></tr></tbody></table>","","33","Ehsan Mustafa","03314714963","","35","hr@ethical.com.pk","94B+rb52iBPK3+AhgjtpsLpZKYl245eBuEl4WlykiWc=","hr@ethical.com.pk","Active","1","2017-02-01","0","");
INSERT INTO employer VALUES("40","2016-01-28 22:59:23","Macter International Ltd.","F-216 S.I.T.E Area Karachi","021-32591000","","42","72","","http://macter.com/","employer_31998.PNG","","<p style=\"text-align: justify;\">Macter International Limited is amongst the leading Pharmaceutical companies in Pakistan. Macter is a public limited company and has a successful 30 years track record in the manufacturing of pharma formulations. The principal activity of the company is to manufacture and market pharmaceutical products. The company enjoys a sterling reputation of quality and is amongst the top 5 manufacturers by volume. Macter has strong corporate governance structure and systems. In view of Macter’s capabilities and growth prospects, International FI’s have recently invested into the company.</p><p style=\"text-align: justify;\">As a company, our first responsibility is to our customers – the doctor who prescribes our product and the patient who uses them. To meet their needs satisfactorily on a long-term horizon, quality consciousness and teamwork is ingrained in all our employees at all levels. As an employer, we recognize the individuality of each employee and seek to develop his/her potential, providing fair compensation in a healthy and safe working environment. As a civic-minded institution, we believe in supporting causes that protect our natural surroundings and uplift the health and educational standards of our community. As a firm in a competitive market, we seek to constantly introduce new and innovative products and systems to meet the changing needs of our customers.</p><p style=\"text-align: justify;\">Currently Macter’s business areas are Contract manufacturing and branded generic formulations. Macter is the largest contract manufacturer in Pakistan particularly for the multinational companies with one of the most advanced production facilities offering a wide range of dosage forms: Oral solids and liquids, Parenterals (ampules and vials), Topicals, Metered dose Inhalers, Ear and Eye drops. Dedicated facilities are available for Cephalosporins, Penicillins & Biologics. The manufacturing operations meet international cGMP standards and are quality management system ISO 9001:2008 certified. Macter’s contract manufacturing clients include a number of blue chips multinationals.</p>","","33","Farrukh Imam","03462016924","","35","hr@macter.com","BPKMBPnI585hG90detCgbOs8SKdYwhzzljLH0PMb5vk=","Farrukh.imam@macter.com","Active","1","2017-02-01","0","");
INSERT INTO employer VALUES("46","2016-02-10 00:21:48","McOlson Laboratories Pvt Ltd"," BOR Society Johar Town Lahore","042 35170405","","0","40","","","","","It has been a matter of fact that increasing healthcare cost is the major issue around the globe and it becomes even critical when it comes to the developing countries of South Asia and Africa. Above all, research work on the newer molecules is being conducted only in a few countries and people of the rest of world are bound to pay unannounced sponsorship in terms of unrealistic prices of life saving drugs. Realization of this fact is the basic element behind incorporation of McOLSON Research Laboratories (Pvt.) Limited, which is contemplated not only to cater the medicinal needs of the countrymen but also to generate valuable foreign exchange through exports of pharmaceutical products to the other parts  of the world. ","","0","Rahat Rauf","042 35222671","","234","careers@mcolsonlabs.com","zcfiIjY2M6sHh2ox8d6I/NgLQWvWJzywsOvr9Tu9sPA=","sales.mcolson.labs@gmail.com","Active","1","2017-02-09","0","");
