INSERT INTO employer VALUES("48","2016-04-21 01:12:30","Kaizen Pharmaceuticals","D -37, Block 7, Clifton","021-35821384-8","","42","72","","kaizen-pharma.com","employer_451.PNG","","<p style=\"text-align: justify;\">Kaizen Pharmaceuticals mission is to become leading pharmaceutical company in Pakistan and in the world by providing the latest and the very best quality medicines to the Patients and Healthcare professionals while employing the latest, high-tech and environment friendly, facilities.</p><p style=\"text-align: justify;\">We shall continuously strive for the success of our organization through research, innovation, training & development, manufacture and marketing of safe and effective medicines.</p><p style=\"text-align: justify;\">We are committed to strive for the growth of our products in terms of quality as well as revenue, which will contribute towards socio-economic strength of the community and will also serve in the well being and growth of our employees.</p><p style=\"text-align: justify;\">We consider our employees as most valuable assets that can make our dreams come true.</p><p style=\"text-align: justify;\">It is our vision to achieve highest accreditations and certifications to provide the very best quality products to our customers at an affordable price.</p>","","33","Iftikhar","03429063695","","66","iftikhar4745@gmail.com","3e3a70gI8kBh2DBk+dYgNCeIUzx7kgrEfzBc5lUdZjk=","iftikhar4745@gmail.com","Active","1","2017-02-01","0","");
INSERT INTO employer VALUES("52","2016-03-15 22:52:11","Herbion Pakistan (Pvt.) Ltd.","Industrial Traiangle, Kahuta Road","021-38679260","","81","38","","","employer_3753.jpg","","<p>medication. This visionary approach has been the driving force behind Herbion’s rapid rise to become one of the leading global organizations and reach out to millions of Satisfied Consumers.</p><p>Herbion was conceived in the year 1983 and with initial operations within the country of its origin (Pakistan) only. By 1997, the Organization started marketing and distributing its products in the Commonwealth of Independent States (CIS) i.e. former Soviet Union, in addition to Pakistan. Gradually the operations expanded through out CIS and later in some other regions such as Eastern Europe, Far East and North America.</p><p>With almost 30 years of experience, a global presence in 5 regions (CIS Markets, Far East, Eastern Europe, Asia and North America), full fledge operations in 25 countries worldwide, and more than 50 products, Herbion continues to enrich the lives of people with it’s Natural Health Care Solutions.</p><p>Furthermore, the organization is in a continuous process of consolidating existing products by creating brand extensions, developing novel research based products and exploring new markets. The company has also emerged as a state of the art manufacturing unit and earned the GMP and ISO 9001-2008, ISO 14000, ISO 22000 and CE certifications. All these factors combined have enabled Herbion to build its confidence with millions of contented Consumers around the world as an Organization that is synonymous with trustworthiness, reliability and well being.</p><p>Maintaining the pace of business diversification Herbion is also entering into various fields with inventive “Natural Products”. In addition to existing herbal formulations and while observing the global trends the organization is diversifying rapidly into the following categories:</p><ol><li>Single Ingredient Dietary Supplements</li><li>Nutritional Food Category</li><li>Personal Care Products</li><li>Household Consumer Products</li></ol><p>With an aim to establish and maintain worldwide leadership in health care through nature based products, the organization also commits itself to play an active role in community development. This responsibility is not just limited to the employees of the organization but also takes into consideration millions of customers across the globe who use Herbion products with conviction.</p>","","33","Shariq Naveed","03213895204","","98","shariq.naveed@herbion.com","/NEG62wdnH8z9V6Nr8GcdX7iXhGexTxoznx4nx5Hhkg=","shariq.naveed@herbion.com","Active","1","2017-03-15","0","");
