INSERT INTO employer VALUES("60","2016-04-14 20:50:56","Indus Pharma","Karachi","02134535253-4","","42","72","","http://indus-pharma.com/","employer_80376.png","","<p style=\"text-align: justify;\"><strong style=\"background-color: initial;\">Indus Pharma (pvt) limited </strong>an (ISO 9001:2008 Certified Company) was founded by the visionary founder Mr. Saeed Ismail in 1969. Since its establishment it has been striving continuously to assure customer satisfaction by providing the best possible quality medicine for common man at an affordable price.</p><p style=\"text-align: justify;\">Being a growing company, Indus Pharma is progressing with a consistent pace to keep the needs and expectations of the health care professionals through developing innovative and better therapeutic products to prevent and treat diseases and improve health and well-being of the people.</p><p style=\"text-align: justify;\">As a manufacturing unit, we are an expert and reliable partner to our customers. We intend to achieve our objectives through our professionalism, committed approach, readiness to respond and our level of services. We have at present two manufacturing sites in Karachi and we have proudly announced expansion plans of our third manufacturing site in Lahore. This manufacturing site is being designed and built according to the latest European and North American standards. We plan to have the site operational in 2014.</p><p style=\"text-align: justify;\">Our standards for conducting business reflect the ethical values of our surrounding culture.</p><p style=\"text-align: justify;\">Compliance is one of our basic principles for over 44 years.</p><p style=\"text-align: justify;\">We intend to maintain the leadership in market through our determination and innovative approach.</p>","","0","Nadeem Sheikh","03369532262","","469","nadeemsheikh.bdm@gmail.com","AUAUWE1syzg059MLNE72FrzsgfnZwp47VOhrHzuvQGU=","nadeemsheikh.bdm@gmail.com","Active","1","2017-02-01","0","");
