INSERT INTO employer VALUES("69","2016-06-01 04:51:37","Scotmann","5-D, I-10/3 Industrial Area","0514430626","","81","38","","www.scotmann.com.pk","employer_69670.png","employer-cover_5339.JPG","<p>Scotmann is a privately owned pharmaceutical company with a differentiated portfolio focused on branded medicines in biotech, cardiovascular, diabetes, gastroenterology, respiratory and inflammatory diseases, pain management, osteoporosis, psychiatry and nutritional supplementation etc. An extensive range of OTC products completes its portfolio.</p><p>Our R&D is structured around partnerships with European Contract Research Organizations (CROs). These partnerships help us adhere to excellent manufacturing practices, ensuring that our products meet highest International standards for safety and potency.</p><p>The company employs highly qualified personnel and its products are available throughout Pakistan. Scotmann plans to further strengthen its position in key neighbouring markets. Headquartered in Islamabad - Pakistan, Scotmann has the distinction of being Pakistan’s first and foremost Biotechnology Company.</p>","","0","Irfan Mughal","0514430626","","35","contactus@scotmann.com.pk","xn0uuaEBE6esw1XXFHPAN+6RCHD6J1seG8NzWPEhJNQ=","irfanidrees@scotmann.com.pk","Active","1","2017-06-01","0","");
