INSERT INTO subscription_accesstype VALUES("24","2015-11-24 11:49:40","unlimited-job-posting","Unlimited Job Posting","Employer can post unlimited jobs after sign up/sign in                                       ","Employer");
INSERT INTO subscription_accesstype VALUES("25","2015-11-24 11:49:40","unlimited-cv-download","Job Specific CV Downloading","<p>All CVs against each job can be downloaded after getting subscribed</p>","Employer");
INSERT INTO subscription_accesstype VALUES("26","2015-11-24 11:49:40","social-media-publishing","Social Media Publishing","<p>Jobs posted will be advertised via social media as well for grabbing more audience</p>","Employer");
INSERT INTO subscription_accesstype VALUES("27","2015-11-24 11:49:40","response-filter","Response Filters","<p style=\"text-align: justify;\">Employer will be able to filter the received applications on the basis of qualification,&nbsp;years of experience, designation worked on and gender.</p>","Employer");
INSERT INTO subscription_accesstype VALUES("28","2015-11-24 11:49:40","short-listing","Online Short-Listing","<p>Employer will be able to shortlist the applicants against each job online through Holistic Jobs and the applicants will be notified through auto generated emails.</p>","Employer");
INSERT INTO subscription_accesstype VALUES("29","2015-11-24 11:49:40","job-with-logo","Job Placement With Logo","<p>Jobs will be placed on website along with company\'s logo</p>","Employer");
INSERT INTO subscription_accesstype VALUES("30","2015-11-24 11:49:40","homepage-exposure","Exposure On Homepage For Specific No. Of Days","<p>Jobs will be visible on the home page for specific no. of days as dictated by subscription plan</p>","Employer");
INSERT INTO subscription_accesstype VALUES("31","2015-11-24 11:49:40","interview-scheduling","Online Interview Scheduling","<p>Employer will be able to schedule interview of any applicant online once shortlisted.Applicant will receive an auto generated email containing details about the interview.</p>","Employer");
INSERT INTO subscription_accesstype VALUES("32","2015-11-24 11:49:40","screening-n-shortlist","Personalized Services For Screening And Shortlisting","<p>Holistic Team will personally do the screening and shortlisting of CVs</p>","Employer");
INSERT INTO subscription_accesstype VALUES("33","2015-11-24 11:49:40","branding-logo","Employer Branding Logo","<p>Corporate\'s logo will be placed on the homepage&nbsp;under \"Best Companies to Work With\"&nbsp;for the time( no. of days) specified by subscription plan</p>","Employer");
INSERT INTO subscription_accesstype VALUES("34","2015-11-24 11:49:40","existing-pool-cvs","Access To Existing Pool Of Cvs ","<p>Employer will be able to access pool of CVs of the employees that are present on Holistic Jobs.</p>","Employer");
INSERT INTO subscription_accesstype VALUES("35","2015-11-24 11:49:40","interviewing","Basic Interviewing","<p>Holistic team will do the basic interviewing for employer</p>","Employer");
INSERT INTO subscription_accesstype VALUES("36","2015-11-24 11:49:40","training","Basic Training","<p>Holistic team will do the basic training of the employee who is being hired</p>","Employer");
INSERT INTO subscription_accesstype VALUES("43","2016-01-11 04:11:32","profile-build-up","Profile Build Up","<p>Employee will be able to create an account on portal and build his profile which will include his personal information, qualification and experience record.</p>","Employee");
INSERT INTO subscription_accesstype VALUES("44","2016-01-11 05:20:35","applying-for-job","Applying for Job","<p>After making profile on the portal, employee will be able to apply against any published job on website.</p>","Employee");
INSERT INTO subscription_accesstype VALUES("45","2016-01-11 05:21:42","job-alerts ","Jobs Alerts","<p>Employee will receive alerts for jobs which match his interested designations, areas and companies.</p>","Employee");
INSERT INTO subscription_accesstype VALUES("46","2016-01-11 05:23:11","tips-to-uplift-profile","Profile Uplift Support","<p>Tips and techniques to uplift candidate\'s profile for the designation or company of interest (Through Holistic Skills Development Programs)</p>","Employee");
INSERT INTO subscription_accesstype VALUES("47","2016-01-11 05:23:59","quarterly-intimation","Quarterly intimation to Companies","<p>Quarterly intimation of candidate\'s achievements and profile uplifts to companies of his interest.</p>","Employee");
INSERT INTO subscription_accesstype VALUES("48","2016-01-11 05:24:55","annual-e-mag","Enrollment for  \"National Pharma Heroes\"","<p>Candidate will be enrolled for &nbsp;\"National Pharma Heroes\" (annual online magazine to be distributed to all pharmaceutical companies)&nbsp;with list of top achievers of every area/town.</p>","Employee");
INSERT INTO subscriptions VALUES("1","2015-11-17 15:34:47","Free Startup Package","<p style=\"text-align: justify;\">Startup Package offers free of cost services. We charge nothing for unlimited job posting, job placement with logo, normal exposure on homepage,social media publishing,&nbsp;CV downloading against each job, online shortlisting and online interview scheduling.&nbsp;</p>","365","0","Featured","Employer");
INSERT INTO subscriptions VALUES("10","2016-01-11 04:09:31","Free Subscription ","<p>It is a basic subscription plan and is offered free of cost. The benefits of this &nbsp; plan include making profile on the job portal and sending CVs to the published jobs.</p>","365","0","Normal","Employee");
INSERT INTO subscriptions VALUES("11","2016-01-11 04:12:30","Advanced Representative","<ul>
INSERT INTO subscriptions VALUES("12","2016-01-11 04:19:28","Executive Representative","<p style=\"text-align: justify;\">It is most beneficial subscription plan with maximum number of services. The benefits of this plan include making profile on job portal and applying for published jobs, email job alerts, candidate\'s profile uplift support,quarterly intimation to companies about candidate\'s achievements and enrollment for online magazine.</p>","365","25","Normal","Employee");
INSERT INTO subscriptions VALUES("13","2016-01-11 04:12:30","Advanced Manager","<ul>
INSERT INTO subscriptions VALUES("14","2016-01-11 04:19:28","Executive Manager","<p style=\"text-align: justify;\">It is most beneficial subscription plan with maximum number of services. The benefits of this plan include making profile on job portal and applying for published jobs, email job alerts, candidate\'s profile uplift support,quarterly intimation to companies about candidate\'s achievements and enrollment for online magazine.</p>","365","50","Normal","Employee");
