INSERT INTO user_manual VALUES("21","2016-01-04 04:07:32","69","How to Shortlist a Candidate?","<p style=\"text-align: justify;\">In \'Published Jobs\' section, against each job there is an \'Applications\' bar, by clicking on applications, a window pops open that contains a button against each candidate saying \"Action awaited\'. Click on the \'Action Awaited\' button in status bar,
INSERT INTO user_manual VALUES("22","2016-01-04 04:11:35","69","How to Ignore a candidate?","<p style=\"text-align: justify;\">In \'Published Jobs\' section, against each job there is an \'Applications\' bar. By clicking on applications, a window pops open that contains a button against each candidate saying \"Action awaited\'.</p><p style=\"text-align: justify;\"> Click on the \'Action Awaited\' button in status bar, option for shortlist and ignore appears. Click on “Ignore” option. The candidate will be informed of his application\'s status.</p>");
INSERT INTO user_manual VALUES("23","2016-01-04 04:12:59","69","Can we view ignored candidates\' details later?","<p>Yes,&nbsp;&nbsp;ignored candidate\'s details can be viewed later.</p>");
INSERT INTO user_manual VALUES("24","2016-01-04 04:24:26","70","What is \'Unpublished Jobs\' section about?","<p style=\"text-align: justify;\">This section contains the jobs whose details have been
INSERT INTO user_manual VALUES("25","2016-01-04 04:27:54","70","How to Unpublish a job?","<p style=\"text-align: justify;\">When you post a job, it automatically moves to \'Published Jobs\', there in front of the job listed,&nbsp;If you press the unpublish button (red envelop icon) present in actions bar, the posted job will automatically disappear from website but will still be there on your portal.&nbsp;</p>");
INSERT INTO user_manual VALUES("26","2016-01-04 04:29:34","70","How to published an unpublished job?","<p style=\"text-align: justify;\">You can always make the unpublished job visible on website by pressing Publish button (green envelop icon) in actions bar in the section of unpublished jobs.&nbsp;</p>");
INSERT INTO user_manual VALUES("27","2016-01-04 04:31:11","70","Can we receive applications against an unpublished job?","<p>No, applications cannot be received against an unpublished job because it is not visible on website and no employee can access or view it.</p>");
INSERT INTO user_manual VALUES("28","2016-01-04 04:32:55","70","If a published job was later unpublished, can we still access applications received against it?","<p>Yes, applications can still be viewed and further actions can still be taken on the applications.</p>");
INSERT INTO user_manual VALUES("29","2016-01-04 04:39:26","70","Can we shortlist/ignore a candidate for an unpublished jobs?","<p>Yes, candidates can be shortlisted/ignored for the unpublished job that was previously published. The procedure for shortlisting/ ignoring will be same as mentioned in Published Jobs section under \'how to shortlist a candidate?\" and \'how to ignore a candidate\'.</p>");
INSERT INTO user_manual VALUES("30","2016-01-04 04:53:35","71","What is \'Expired Jobs\'  section about?","<p style=\"text-align: justify;\">Jobs
INSERT INTO user_manual VALUES("31","2016-01-04 04:55:46","71","Can we edit the date for expired jobs?","<p>You can change(extend) the deadline for the job by using edit button in front of the job and it will automatically move to the published jobs and will again be visible on website as well.</p>");
INSERT INTO user_manual VALUES("32","2016-01-04 04:58:00","71","Can we access application after the job has expired?","<p style=\"text-align: justify;\">In front of the expired job, option to view applications and to shortlist/ignore is available.</p>");
INSERT INTO user_manual VALUES("33","2016-01-04 22:35:47","72","How do I change my login email?","<p>Account Settings section allows you to change your login email. Write the new email Id in the field and it will be verified.</p>");
INSERT INTO user_manual VALUES("34","2016-01-04 22:56:34","73","How do I change my password?","<p>Password can be changed in Account Settings section. Write the current password in the field provided, write the new password and then again type it for confirmation.</p>");
INSERT INTO user_manual VALUES("35","2016-01-04 23:33:17","73","What if I forget my password?","<p>If you forget your password, you can retrieve it anytime. In the Log In window on website, under log in details field, you can see \"Forgot your Password?\". Click on this, a window will pop up asking to enter email Id, once you do it, an auto generated password will be sent to this email ID.</p>");
INSERT INTO user_manual VALUES("36","2016-01-05 00:46:31","74","Why are basic details required?","<p style=\"text-align: justify;\">Employer is required to fill basic details about corporate in this section. Basic details make up a company\'s public profile so that whenever it posts a job, employee should be able to have company\'s brief introduction.</p>");
INSERT INTO user_manual VALUES("37","2016-01-05 00:49:13","75","Who is \"Contact Person\"?","<p>Contact person refers to the company\'s representative usually HR Manager/HR officer but could be any employee from corporate that looks after HR department.</p>");
INSERT INTO user_manual VALUES("38","2016-01-05 00:52:50","75","Why are contact person details required?","<p>A contact person\'s details should be provided so that he/she can be contacted in case of any query regarding job\'s information.</p>");
INSERT INTO user_manual VALUES("39","2016-01-05 00:54:03","75","Are contact person details public?","<p>No, they are not visible to public. They are provided for Holistic Jobs Only.</p>");
INSERT INTO user_manual VALUES("40","2016-01-05 00:56:31","76","What is Public Profile?","<p style=\"text-align: justify;\">\'Basic Details\' along with \'Public Profile\' make up a company\'s profile that public can view.&nbsp;In this section, write a brief introduction of your company
INSERT INTO user_manual VALUES("41","2016-01-05 00:58:54","77","Is uploading logo mandatory?","<p>Yes, employer is required to upload a logo for the corporate confirming to the mentioned size as it is the identity for any company.&nbsp;</p>");
INSERT INTO user_manual VALUES("42","2016-01-05 01:00:50","77","What does cover mean?","<p>Cover is the banner for your company. It will appear on the top of company profile page on website. However, uploading it is optional.</p>");
INSERT INTO user_manual VALUES("43","2016-01-05 01:32:31","78","What is this \"Subscription\" section about?","<p>This section enlists all services Holistic Jobs aims to offer.&nbsp;Right now, services with \"tick\" sign are offered and with \"cross\' sign are not offered.</p><p>Services not offered in the launched plan will be included in upcoming advanced subscription plans. Their details will be disclosed later.</p>");
INSERT INTO user_manual VALUES("45","2016-01-16 00:47:31","67","How do I change my login email?","<p>Account Settings section allows you to change your login email. Write the new email Id in the field and it will be verified by sending you an email on your new entered email ID.</p>");
INSERT INTO user_manual VALUES("46","2016-01-16 00:57:29","66","How do I change my password?","<p>Password can be changed in Account Settings section. Write the current password in the field provided, write the new password and then again type it for confirmation.</p>");
INSERT INTO user_manual VALUES("47","2016-01-16 00:58:20","66","What if I forget my password?","<p>If you forget your password, you can retrieve it anytime. In the Log In window on website, under log in details field, you can see \"Forgot your Password?\". Click on this, a window will pop up asking to enter email Id, once you do it, an auto generated password will be sent to this email ID.</p>");
INSERT INTO user_manual VALUES("48","2016-01-16 00:59:35","82","What is \"Subscription\" section about?","<p>This section contains 3 different plans with list of services Holistic Jobs aims to offer. Services with \"tick\" sign are offered and with \"cross\' sign are not offered.</p><p>You have to choose one plan before getting started.</p>");
INSERT INTO user_manual VALUES("49","2016-01-16 01:05:17","82","Can I change my subscription plan?","<p style=\"text-align: justify;\">Yes, subscription can be updated anytime.<br>For Example: If you have opted for Free Subscription, you can change it to Advanced/ Executive anytime.</p>");
INSERT INTO user_manual VALUES("50","2016-01-16 01:10:04","79","Why are basic details required?","<p>Employee is required to enter his personal information in order to build a complete profile.</p>");
INSERT INTO user_manual VALUES("51","2016-01-16 01:14:19","79","Who can see my personal information?","<p>Your personal information is not public. We take great care of your privacy and confidentiality. </p>");
INSERT INTO user_manual VALUES("52","2016-01-16 01:18:27","79","What if I don\'t want to upload my picture?","<p>Uploading a profile picture is not mandatory, it is totally optional. If you do not feel comfortable, you may not upload a picture.</p>");
INSERT INTO user_manual VALUES("53","2016-01-16 01:24:51","80","What is \"My Job Alerts\" section about?","<p>Job Alerts is one of the fantastic service by Holistic Jobs. In this section, you add designation, city and company of your choice. Now, whenever a job is published on website that matches your mentioned interests, you will receive an email alert regarding that job.</p><p>So, even if you are not visiting portal regularly, you still can stay updated with recent job postings of your interest.</p>");
INSERT INTO user_manual VALUES("54","2016-01-16 01:33:41","84","What is \"Applied Jobs\" section about?","<p>This section contains all the jobs you have applied for with their status and application date.</p>");
INSERT INTO user_manual VALUES("55","2016-01-16 01:39:10","84","Where can I see If I am shortlisted or not?","<p>In My Jobs section, in Applied Jobs, against each job there is a field for status. Here, you can see the status of your application whteher you are shortlisted or not.</p>");
INSERT INTO user_manual VALUES("56","2016-01-16 01:45:02","85","What is \"Scheduled Interviews\" section about?","<p>This section contains all the jobs that you applied for and an interview is scheduled after being shortlisted. You can view the date and venue of interview against each job.&nbsp;</p>");
INSERT INTO user_manual VALUES("57","2016-01-16 01:48:36","83","What is \"My Resume\" section about?","<p>This section is meant for CV uploading and downloading. With \"choose file\" button on the right, you can upload your CV.</p>");
INSERT INTO user_manual VALUES("58","2016-01-16 01:51:09","83","Can i upload multiple CVs?","<p>Yes, you can upload multiple CVs on your account and give them a title so that they can be distinguished. When you apply for any job from your portal, you can then attach the relevant CV with the application.</p>");
INSERT INTO user_manual VALUES("59","2016-01-16 01:52:40","83","Can we download a CV from portal?","<p>Yes, all the CVs you uploaded are downloadable. On left side, under All Resumes, against each application, there is a download button.</p>");
INSERT INTO user_manual VALUES("60","2016-01-16 02:40:31","86","After logging in to my account, where can I view jobs\' ads?","<p>After logging in to your account, on left side of the screen, there is an option of \"Website\" which will take you to the home page of website. From here you can search published jobs and apply for them.</p>");
